import React from 'react';
import { Link } from 'react-router-dom';

const workItems = [
  { id: 'downtown-ring', title: 'Downtown Ring', image: './images/downtown.jpg' },
  { id: 'memory-pendant', title: 'Memory Pendant', image: './images/memory.jpg' },
  { id: 'memory-pendant', title: 'Memory Pendant', image: './images/memory.jpg' },
  { id: 'memory-pendant', title: 'Memory Pendant', image: './images/memory.jpg' },
  { id: 'memory-pendant', title: 'Memory Pendant', image: './images/memory.jpg' },
  { id: 'memory-pendant', title: 'CB', image: './public/CB-01.png' },
];

function Main() {
  return (
    <div className="grid">
      {workItems.map(item => (
        <div key={item.id} className="grid-item">
          <Link to={`/work/${item.id}`}>
            <img src={item.image} alt={item.title} />
          </Link>
          <p>{item.title}</p>
        </div>
      ))}
    </div>
  );
}

export default Main;
